import React from 'react'
import './cta.css';

const CTA = () => {
  return (
    <div className='gpt3__cta'>
      <div className='gpt3__cta-content'>
        <p>Kobiece szyje potrzebują Ciebie!</p>
        <h3>Dołącz do nas już dziś i zacznij poznawać nieograniczone możliwości.</h3>
      </div>
      <div className='gpt3__cta-btn'>
        <button type='button'>Zapisz się</button>
      </div>
    </div>
  )
}

export default CTA
